import CartStyles from './styles/CartStyles';
import Supreme from './styles/Supreme';
import { useUser } from './User';

export default function Cart() {
  const user = useUser();

  if (!user) return null;

  return (
    <CartStyles open>
      <header>
        <Supreme>{user.name}'s cart</Supreme>
      </header>
    </CartStyles>
  );
}
